package app;import java.util.Scanner;public class Main {    public static void main(String[] args) {        Scanner scanner = new Scanner(System.in);        double N = Double.parseDouble(scanner.nextLine());        double W = Double.parseDouble(scanner.nextLine());        double L = Double.parseDouble(scanner.nextLine());        double M = Double.parseDouble(scanner.nextLine());        double O = Double.parseDouble(scanner.nextLine());        double ploshtadka = N * N;        double plochki = W * L;        double peika = M * O;        double broi = (ploshtadka - peika) / plochki;        double time = broi * 0.2;        System.out.printf("%.2f%n", broi);        System.out.printf("%.2f%n", time);    }}